package femtodb.core.table;import java.util.*;public class DefaultTableIterator implements TableIterator {    private Iterator iterator = null;    private Map.Entry nowEntry = null;    public DefaultTableIterator(Iterator iterator) {        this.iterator = iterator;    }    public boolean hasNext() {        return this.iterator.hasNext();    }    public Map.Entry next() {        return (Map.Entry)this.iterator.next();    }    public void nextEntry() {        this.nowEntry = (Map.Entry)this.iterator.next();    }    public Object getEntryKey() {        return this.nowEntry.getKey();    }    public Object getEntryValue() {        return this.nowEntry.getValue();    }    }